              priority: task.priority,
              columnId: task.columnID,
            });
          });
          newColumn = new Column({
            _id: column.id,
            title: column.title,
            limit: column.limit,
            tasks: tasks,
            index: column.index
          });
          newColumn.save().then({});
          return newColumn;
        }))
    )
    .then(() => res.json(newState));
});

// ------------------------------- /COLUMNS -------------------------------

